webpackJsonp([0x9dee9cb545d12800],{"./node_modules/json-loader/index.js!./.cache/json/linux-how-to-download-files-with-wget.json":function(e,n){e.exports={data:{markdownRemark:{html:'<h2>How to download files using the “wget” utility in Linux</h2>\n<p>This article is a quick tutorial on using the <code>wget</code> utility on Unix based OS.\nGNU Wget is a free utility for non-interactive download of files from the Web. It supports HTTP, HTTPS, and FTP protocols, as well as retrieval through HTTP proxies.</p>\n<h3>Installing <code>wget</code></h3>\n<p>The wget utility is freely available package and licensed under the GNU GPL License. This utility can be installed on any Unix-like OS including Windows and MacOS.</p>\n<h3>Basic syntax</h3>\n<p>The basic syntax of the <code>wget</code> is…</p>\n<div class="gatsby-highlight">\n      <pre class="language-none"><code>wget [option]... [URL]...</code></pre>\n      </div>\n<h3>Details of wget</h3>\n<div class="gatsby-highlight">\n      <pre class="language-none"><code>wget --version</code></pre>\n      </div>\n<div class="gatsby-highlight">\n      <pre class="language-none"><code>wget --help</code></pre>\n      </div>\n<h3>Downloading a single file</h3>\n<div class="gatsby-highlight">\n      <pre class="language-none"><code>wget http://ftp.gnu.org/gnu/wget/wget-1.5.3.tar.gz</code></pre>\n      </div>\n<h3>Downloading from FTP</h3>\n<div class="gatsby-highlight">\n      <pre class="language-none"><code>wget ftp://ftp.gnu.org/gnu/wget/wget-1.10.1.tar.gz.sig</code></pre>\n      </div>\n<h3>Restrict download speed limits</h3>\n<div class="gatsby-highlight">\n      <pre class="language-none"><code>wget --limit-rate=100k http://ftp.gnu.org/gnu/wget/wget-1.5.3.tar.gz</code></pre>\n      </div>\n<p>You can play with remaining features of the <code>wget</code> utility</p>',fields:{slug:"/linux/how-to-download-files-with-wget/"},frontmatter:{title:'How to download files using the "wget" utility in Linux'}}},pathContext:{slug:"/linux/how-to-download-files-with-wget/"}}}});
